    this.dm.setField ( this.dm.get ( "REPORT_6_4_FIX_DSD" ), "TECNICO", this.dm.getFieldDouble ( this.dm.get ( "REPORT_6_4_DSD" ), "CALENDARIO_ID_TECNICO" ) );
