        this.dm.setField ( this.dm.get ( "TECNICO_READ_DSD" ), "ID_TECNICO", this.dm.getFieldDouble ( this.dm.get ( "REPORT_6_4_DSD" ), "CALENDARIO_ID_SUPERVISOR" ) );

